(function(jQuery){window.SearchResults={};SearchResults.printLink=function(element,postID){if(postID){jQuery(element).removeClass("disabled");jQuery(element).attr("href","?p="+postID)}else{jQuery(element).addClass("disabled")}};SearchResults.printCurrentResultPosition=function(element,position,results){if(!isNaN(position)&&position<results){jQuery(element).children(".oes-result-navigation-position-first").html(position+1);jQuery(element).children(".oes-result-navigation-position-last").html(results)}};SearchResults.printReturnToResultsLink=function(element){const returnToSearchLink=localStorage.getItem("oesSearchResultsURL");if(returnToSearchLink){jQuery(element).attr("href",returnToSearchLink)}else{jQuery(element).addClass("disabled")}}})(jQuery);jQuery(document).ready(function(){const navigation=jQuery(".oes-result-navigation");if(navigation.length>0){navigation.hide();const displayed_ids=localStorage.getItem("oesDisplayedIds");if(displayed_ids.length>0){const results=JSON.parse(displayed_ids);const current_id=parseInt(oesPaging.current_id);let position=results.indexOf(current_id);if(!isNaN(position)&&results.length>0&&position>-1){let next_id=false;let previous_id=false;if(results[position+1]!==undefined)next_id=results[position+1];if(position>0)previous_id=results[position-1];SearchResults.printLink(".oes-result-navigation-next",next_id);SearchResults.printCurrentResultPosition(".oes-result-navigation-position",position,results.length);SearchResults.printLink(".oes-result-navigation-previous",previous_id);SearchResults.printReturnToResultsLink(".oes-result-navigation-back");navigation.show()}}}jQuery(".oes-reset-filter").on("click",function(event){localStorage.setItem("oesSelectedFilter",null)})});